import {connect} from "react-redux";
import ActivitiesElem from '../ActivitiesFrame/ActivitiesElem/ActivitiesElem'  
import styles from './index.module.css';
import React from 'react';
import Text from '../Text/Text'
function getResponse(data, request) {
    // TODO
    return data
}

function Response(props) {
    const request = props.request
    const response = getResponse(props.data, request)
    return (
        <div>
            <Text>{request}</Text>
            <div className = {styles.activities_list}>
                {response.map(elem =>
                        <ActivitiesElem key = {elem.id} props={elem}>
                        </ActivitiesElem>)}
            </div>
        </div>
    )
}

const mapStateToProps = (state) => {
    return {
      data: state.data    
    }
  };

export default connect(mapStateToProps)(Response)
